import React from "react";
import { GrClose } from "react-icons/gr";
import styled from "styled-components";

const CloseIconWrapper = styled.svg`
  width: 100%;
  height: 100%;
`;

export const CloseIcon = () => (
  <CloseIconWrapper aria-hidden="true">
    <GrClose />
  </CloseIconWrapper>
);
